  `data_cadastro` date DEFAULT NULL COMMENT 'Data de cadastro do produto',
  `ativo` tinyint(1) DEFAULT '1' COMMENT 'Indica se o produto está ativo',
  PRIMARY KEY (`id_produto`),
  UNIQUE KEY `codigo_barras` (`codigo_barras`),
  KEY `fk_produto_categoria` (`id_categoria`),
  KEY `fk_produto_fornecedor` (`id_fornecedor`),
